import { useEffect, useState } from "react";
import "../App.css";


function MyAppointment() {
  const[appointments, setAppointments] = useState([]);
  useEffect(() => {
    fetch("http://localhost:5000/api/appointments/myappointments", {
      headers: {
        Authorization: localStorage.getItem("token"),
      },
    })
      .then((res) => res.json())
      .then((data) => setAppointments(data));
  }, []);
  const [getMyAppointments] = MyAppointment(); // Assuming this hook exists
 useEffect(() => {
    const fetchAppointments = async () => {
      try {
        const data = await getMyAppointments();
        setAppointments(data.appointments || []); // ensure array
      } catch (error) {
        console.error(error);
      }
    };
    fetchAppointments();
  }, []);

  return (
     <div>
      <h2>My Appointments</h2>
      {appointments.map((item) => (
        <div key={item.id}>
          {item.name} - {item.date}
        </div>
      ))}
    </div>
  );
}

export default MyAppointment;
